import React from 'react';
import { Container, Box, Typography } from '@mui/material';

const About = () => {
  return (
    <Container maxWidth="lg">
      <Box
        style={{
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          flexDirection: 'column',
          textAlign: 'left',
          padding: '0 25%'
        }}
      >
        <Typography variant="h4" style={{ marginBottom: '20px' }}>
          Passionate Technologist at the Intersection of Crypto, Space, and AI
        </Typography>
        <Typography variant="body1" color="textSecondary">
          As a seasoned technologist, my journey has been fueled by an insatiable curiosity and a drive to pioneer innovations at the convergence of crypto, space exploration, and artificial intelligence. With a decade-plus experience in software engineering, my path has been anything but ordinary.
          <br /><br />
          In the realm of cryptocurrency, I've embraced the challenge of decentralized systems, aspiring to enhance financial inclusivity and transparency. My work in blockchain technology extends beyond mere transactions; it's about forging trust in a trustless environment, fostering a new era of digital economics.
        </Typography>
      </Box>
    </Container>
  );
};

export default About;
